import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from '../Pages/Home.js';
import Dashboard from '../Pages/Dashboard.js'
import ChannelsByGenre from '../Pages/ChannelsByGenre.js';
import AllGenres from '../Pages/AllGenres.js';
import AuthorizedNavBar from '../Components/authorized/AuthorizedNavBar.js';
import MyFavourites from '../Components/authorized/MyFavourites.js';
import MyProfile from '../Components/authorized/MyProfile.js';

export default function AuthorizedRoutes() {
  return (
    <Router>
      <div style={{ backgroundColor: '#EDE4E0' }}>
        <AuthorizedNavBar>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/:genre" element={<ChannelsByGenre />} />
            <Route path="/genres" element={<AllGenres />} />
            <Route path="/favourites" element={<MyFavourites />}/>
            <Route path="/profile" element={<MyProfile />}/>
          </Routes>
        </AuthorizedNavBar>
      </div>
    </Router>
  )
}
